import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

function hui() {
  return (
    <div className="app-wrapper">
      <Header /> 

      <nav className="navbar">
        <div>
          <a href="">Messages</a>
        </div>
        <div>
          <a href="">News</a>
        </div>
        <a href="">Music</a>
        <div>
          <a href="">Settings</a>
        </div>
      </nav>

      <div className="content">
        текст
      </div>
    </div>
  );
}

export default hui;
